import React from 'react';
import FilterLink from '../containers/FilterLink';
import { VisibilityFilter } from '../actions';

const Footer = () => (
    <div>
        <span>Show: </span>
        <FilterLink filter={setVisibilityFilter.SHOW_ALL}>All</FilterLink>
        <FilterLink filter={setVisibilityFilter.SHOW_ACTIVE}>Active</FilterLink>
        <FilterLink filter={setVisibilityFilter.SHOW_COMPLETED}>
            Completed
        </FilterLink>
    </div>
);
export default Footer;
